import React, { useState, useEffect } from "react";
import axios from "axios";
import { useParams } from "react-router-dom";

const DeliverymanDetail = () => {
    const { name } = useParams();
    const { id } = useParams();
    const [details, setDetails] = useState([]);

    useEffect(() => {
        axios.get(`deliveryMan/details/${id}/${name}`)
        // axios.get("http://127.0.0.1:8000/api/product/details/"+id+"/"+name)
            .then(resp => {
                console.log(resp.data);
                setDetails(resp.data);
            }).catch(err => {
                console.log(err);
            });
    }, []);

    return (
        <div className="container">
            <div className="">
                <h1>DeliveryMan Details</h1>
                <img src={`http://127.0.0.1:8000/storage/deliveryMans_images/${details.image}`} width="180px" height="190px" alt="" />
                <h3>First name: {details.f_name}</h3>
                <h3>Last name: {details.l_name}</h3>
                <h3>Email: {details.email}</h3>
                <h3>Phone: {details.phone}</h3>
                <h3>Date of Birth: {details.dob}</h3>
                <h3>Gender: {details.gender}</h3>
                <h3>Joining Date: {details.joining_date}</h3>
                <h3>Address: {details.address}</h3>
            </div>
        </div>

    )

}
export default DeliverymanDetail;
